import React from 'react';
import logo from './logo.svg';
import './App.css';

import { Home } from 'shared/pages/home/home.jsx';
//import { Education } from 'shared/pages/education/education';
import { Lesson } from 'shared/pages/education/lesson';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <
        img src = { logo }
        className = "App-logo"
        alt = "logo" / >

        <
        /header> <
        Router >
        <
        Switch >
        <
        Route path = "/"
        component = { Home }
        exact / >
        <
        Route path = "/education"
        component = { Education }
        exact / >
        <
        Route exact path = "/education/:lessonID"
        render = {
            (props) => < Lesson {...props }
            />} / >
            <
            /Switch> <
            /Router> <
            /div>
        );
    }

    export default App;
